import React, { Component } from 'react';
import "./GeneralSorting.css";

class Generation extends Component {
    mystyle = {
        textAlign: "right"
    };
    render() {
        return (
            <div className="my-border">
                <div className="my-bold">{this.props.name}</div>
                <div>
                    <label> 
                        Avoid duplicates:
                        <input type="checkbox" />
                    </label>
                </div>
                <div style={this.mystyle}>
                    <label> 
                        Number of items:
                        <input type="text" />
                    </label>
                </div>
                <div style={this.mystyle} >
                    <label> 
                        Max value:
                        <input type="text" />
                    </label>
                </div>
                <button className="my-button">Generate</button>
            </div>
        );
    }
}

export default Generation;
